import React from 'react'
import FeatureBox from './FeatureBox'
import FeatureImage from '../images/logo_gunma1.png';

function Feature() {
    return (
        <div id='features'>
            <div className= 'a-container'>
                <FeatureBox image = {FeatureImage} />
            </div>
        </div>
    )
}
